import React from 'react';
import Helmet from 'react-helmet';
import './title.scss';

const defaultTitle = 'RUMAH SEHAT';

function Title(props) {
    const { title, children } = props;
    return (
        <div className="title">
            <Helmet
                title={title ? `${title} | Sehatq Fandi` : defaultTitle}
            />
            {children}
        </div>
    );
}
export default Title;
